import React from 'react';

const ListSection = () => {
  const lists = ['Item 1', 'Item 2', 'Item 3', 'Item 4'];

  return (
    <section>
      <ul>
        {lists.map((item, index) => (
          <li key={index}>{item}</li>
        ))}
      </ul>
    </section>
  );
};

export default ListSection;
